cars.description:
Vi välkomnar nya Peugeot Expert, ett tillskott med modernare utseende och nya funktioner.  Nu till ett fantastiskt bra pris för en helt ny bil med 0 mil på mätaren och alla garantier för ett tryggt, enkelt, bekvämt och problemfritt bilägande. 

Varmt Välkomna att kontakta jonas.belfrage@kronobergsbil.se eller 0470-71 91 16 för mer information, frågor eller finansieringsupplägg. 

Vi erbjuder ett komplett transportbilscenter med ombyggnationer från inredning, belysning och dekor.

10tum digitalt förarkluster; 10tum touchscreen, Bluetooth & USB; 17tum stålfälgar, hel navkapsel (Kan ej kombineras med speciallack); Automatisk klimatanläggning inkl. kylbart handskfack; Dödavinkelvarnare; Elektrisk parkeringsbroms; Elinfällbara sidospeglar; Flankguard; Full Eco LED strålkastare; Hellackerad kaross (Backspeglar i Svart Perla Nera, LED - varselljus och dimstrålkastare (Kan ej kombineras med speciallack); Keyless, nyckelfritt lås- och startsystem; Moduwork, uppfällbart passagerarsäte (0, 5m3 extra lastvolym); Parkeringssensorer bak; Parkeringssensorer fram; Surround View (Kamera med två vinklar); Trådlös mobilladdare; 
12V-uttag i kupé och i lastutrymmet; Fästöglor i golvet, 6st L2 och 8st L3; Komfortmellanvägg med fönster samt lastlucka; Skyddsinklädnad väggar och golv; Utökad lastkapacitet; 
ABS(låsningsfria bromsar); AEBS (Advanced Emergency braking system); Airbag förare och passagerare samt sidoairbags; Däcktrycksensor TPMS; EBA(nödbromsassistans); Elektronisk startspärr; ESP(antisladdsystem) med ASR(antispinnsystem); Filhållningsassistans; Helljusassistent; Hill assist(hjälp vid start i backe); Högt placerat bromsljus; Nackskydd justerbara i höjd; Regnsensor; Trafikskyltsavläsning; Trepunktsbälten på samtliga platser; VAEB (Videoassisterad Autobroms); 

3 års fabriksgaranti/10000mil. 3 års assistans, 5 års genomrostningsgaranti. 3 års
lackgaranti. 1 års garanti på eftermonterat tillbehör.
